import "./App.css";
import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";

function Home() {
  return <h2 className="text-center 4xl font-bold mt-10">Home Page</h2>;
}

function About() {
  return <h2 className="text-center text-4xl font-bold mt-10">About Page</h2>;
}

function Contact() {
  return <h2 className="text-center text-4xl font-bold mt-10">Contact Page</h2>;
}

function App() {
  return (
    <Router>
      <nav>
        <Link to="/">Home</Link> |
        <Link to="/about">About</Link> |
        <Link to="/contact">Contact</Link> |
      </nav>

      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/contact" element={<Contact />} />
        {/* <Route path="/*" element={<NotFount />} /> */}
      </Routes>
    </Router>
  );
}

export default App;
